args.content:
{
  "canvas": {
    "width": 1080,
    "height": 1920,
    "background": { "type": "solid", "color": "#F0F8FF" }
  },
  "header": {
    "title": {
      "text": "Doraemon Explains: Mixture of Experts (MOE)",
      "position": { "x": 540, "y": 100 },
      "style": {
        "fontFamily": "Doraemon, sans-serif",
        "fontSize": 48,
        "fontWeight": "bold",
        "color": "#0095D9",
        "textAlign": "center",
        "stroke": "#FFFFFF",
        "strokeWidth": 4,
        "textShadow": "3px 3px 0px #FFD700"
      }
    }
  },
  "panels": [
    {
      "id": "panel1",
      "position": { "x": 90, "y": 200 },
      "size": { "width": 450, "height": 380 },
      "border": { "width": 4, "color": "#000000", "radius": 12 },
      "background": "#FFFFFF",
      "scene": {
        "location": "Nobita's Room",
        "characters": [
          {
            "name": "Nobita",
            "position": { "x": 100, "y": 100 },
            "expression": "stressed, confused",
            "pose": "sitting at desk with books scattered, head in hands"
          },
          {
            "name": "Doraemon",
            "position": { "x": 300, "y": 150 },
            "expression": "concerned, thinking",
            "pose": "standing nearby, hand on chin"
          }
        ],
        "dialogues": [
          {
            "speaker": "Nobita",
            "text": "I can't do this! Math, science, history... it's too much!",
            "position": { "x": 150, "y": 280 },
            "style": {
              "bubbleType": "speech",
              "backgroundColor": "#FFFFFF",
              "borderColor": "#000000",
              "fontSize": 20,
              "textAlign": "center"
            }
          }
        ],
        "props": ["textbooks", "pencils", "eraser"]
      }
    },
    {
      "id": "panel2",
      "position": { "x": 540, "y": 200 },
      "size": { "width": 450, "height": 380 },
      "border": { "width": 4, "color": "#000000", "radius": 12 },
      "background": "#FFFFFF",
      "scene": {
        "location": "Nobita's Room",
        "characters": [
          {
            "name": "Doraemon",
            "position": { "x": 250, "y": 100 },
            "expression": "excited, inspired",
            "pose": "reaching into 4D pocket"
          },
          {
            "name": "Nobita",
            "position": { "x": 100, "y": 150 },
            "expression": "curious, hopeful",
            "pose": "leaning forward"
          }
        ],
        "dialogues": [
          {
            "speaker": "Doraemon",
            "text": "I have the perfect gadget! The Mixture of Experts Device!",
            "position": { "x": 250, "y": 280 },
            "style": {
              "bubbleType": "speech",
              "backgroundColor": "#FFFFFF",
              "borderColor": "#000000",
              "fontSize": 20,
              "textAlign": "center"
            }
          }
        ],
        "props": ["4D pocket", "glowing gadget"]
      }
    },
    {
      "id": "panel3",
      "position": { "x": 90, "y": 600 },
      "size": { "width": 450, "height": 380 },
      "border": { "width": 4, "color": "#000000", "radius": 12 },
      "background": "#FFFFFF",
      "scene": {
        "location": "Park",
        "characters": [
          {
            "name": "Shizuka",
            "position": { "x": 100, "y": 100 },
            "expression": "smart, confident",
            "pose": "holding science textbook"
          },
          {
            "name": "Giant",
            "position": { "x": 300, "y": 100 },
            "expression": "strong, determined",
            "pose": "flexing muscles"
          }
        ],
        "dialogues": [
          {
            "speaker": "Doraemon (off-panel)",
            "text": "Shizuka is our Science Expert! Giant is our Math Expert!",
            "position": { "x": 225, "y": 280 },
            "style": {
              "bubbleType": "narrator",
              "backgroundColor": "#E6F7FF",
              "borderColor": "#0095D9",
              "fontSize": 18,
              "textAlign": "center"
            }
          }
        ],
        "props": ["science equipment", "math symbols floating"]
      }
    },
    {
      "id": "panel4",
      "position": { "x": 540, "y": 600 },
      "size": { "width": 450, "height": 380 },
      "border": { "width": 4, "color": "#000000", "radius": 12 },
      "background": "#FFFFFF",
      "scene": {
        "location": "Park",
        "characters": [
          {
            "name": "Suneo",
            "position": { "x": 100, "y": 100 },
            "expression": "proud, artistic",
            "pose": "holding paintbrush and palette"
          },
          {
            "name": "Nobita",
            "position": { "x": 300, "y": 150 },
            "expression": "surprised, learning",
            "pose": "watching everyone"
          }
        ],
        "dialogues": [
          {
            "speaker": "Doraemon (off-panel)",
            "text": "Suneo is our Art Expert! Each friend specializes in one thing!",
            "position": { "x": 225, "y": 280 },
            "style": {
              "bubbleType": "narrator",
              "backgroundColor": "#E6F7FF",
              "borderColor": "#0095D9",
              "fontSize": 18,
              "textAlign": "center"
            }
          }
        ],
        "props": ["art supplies", "colorful paintings"]
      }
    },
    {
      "id": "panel5",
      "position": { "x": 90, "y": 1000 },
      "size": { "width": 450, "height": 380 },
      "border": { "width": 4, "color": "#000000", "radius": 12 },
      "background": "#FFFFFF",
      "scene": {
        "location": "Park",
        "characters": [
          {
            "name": "Doraemon",
            "position": { "x": 225, "y": 100 },
            "expression": "explaining, pointing",
            "pose": "standing with MOE device"
          },
          {
            "name": "Nobita",
            "position": { "x": 225, "y": 200 },
            "expression": "listening carefully",
            "pose": "sitting attentively"
          }
        ],
        "dialogues": [
          {
            "speaker": "Doraemon",
            "text": "I'm the ROUTER! When you ask a question, I send it to the RIGHT expert!",
            "position": { "x": 225, "y": 320 },
            "style": {
              "bubbleType": "speech",
              "backgroundColor": "#FFFFFF",
              "borderColor": "#000000",
              "fontSize": 18,
              "textAlign": "center"
            }
          }
        ],
        "props": ["MOE device with lights", "arrows pointing to friends"]
      }
    },
    {
      "id": "panel6",
      "position": { "x": 540, "y": 1000 },
      "size": { "width": 450, "height": 380 },
      "border": { "width": 4, "color": "#000000", "radius": 12 },
      "background": "#FFFFFF",
      "scene": {
        "location": "Park",
        "characters": [
          {
            "name": "Nobita",
            "position": { "x": 150, "y": 100 },
            "expression": "asking question",
            "pose": "holding up math problem"
          },
          {
            "name": "Doraemon",
            "position": { "x": 300, "y": 100 },
            "expression": "routing",
            "pose": "pressing device buttons"
          }
        ],
        "dialogues": [
          {
            "speaker": "Nobita",
            "text": "What's 15 √ó 24?",
            "position": { "x": 150, "y": 250 },
            "style": {
              "bubbleType": "speech",
              "backgroundColor": "#FFFFFF",
              "borderColor": "#000000",
              "fontSize": 22,
              "textAlign": "center"
            }
          },
          {
            "speaker": "Doraemon",
            "text": "Math question! Sending to Giant!",
            "position": { "x": 300, "y": 320 },
            "style": {
              "bubbleType": "speech",
              "backgroundColor": "#FFFFFF",
              "borderColor": "#000000",
              "fontSize": 18,
              "textAlign": "center"
            }
          }
        ],
        "props": ["math problem paper", "device showing 'MATH ‚Üí GIANT'"]
      }
    },
    {
      "id": "panel7",
      "position": { "x": 90, "y": 1400 },
      "size": { "width": 450, "height": 380 },
      "border": { "width": 4, "color": "#000000", "radius": 12 },
      "background": "#FFFFFF",
      "scene": {
        "location": "Park",
        "characters": [
          {
            "name": "Giant",
            "position": { "x": 225, "y": 100 },
            "expression": "confident, solving",
            "pose": "holding calculator, lightbulb above head"
          },
          {
            "name": "Nobita",
            "position": { "x": 225, "y": 200 },
            "expression": "amazed, happy",
            "pose": "receiving answer"
          }
        ],
        "dialogues": [
          {
            "speaker": "Giant",
            "text": "360! Easy peasy!",
            "position": { "x": 225, "y": 280 },
            "style": {
              "bubbleType": "speech",
              "backgroundColor": "#FFFFFF",
              "borderColor": "#000000",
              "fontSize": 24,
              "textAlign": "center"
            }
          },
          {
            "speaker": "Nobita",
            "text": "Wow! So fast!",
            "position": { "x": 225, "y": 340 },
            "style": {
              "bubbleType": "speech",
              "backgroundColor": "#FFFFFF",
              "borderColor": "#000000",
              "fontSize": 20,
              "textAlign": "center"
            }
          }
        ],
        "props": ["calculator", "answer display", "sparkles"]
      }
    },
    {
      "id": "panel8",
      "position": { "x": 540, "y": 1400 },
      "size": { "width": 450, "height": 380 },
      "border": { "width": 4, "color": "#000000", "radius": 12 },
      "background": "#FFFFFF",
      "scene": {
        "location": "Park",
        "characters": [
          {
            "name": "Doraemon",
            "position": { "x": 225, "y": 100 },
            "expression": "proud, teaching",
            "pose": "holding MOE device, explaining"
          },
          {
            "name": "Nobita",
            "position": { "x": 225, "y": 200 },
            "expression": "understanding, excited",
            "pose": "clapping happily"
          }
        ],
        "dialogues": [
          {
            "speaker": "Doraemon",
            "text": "That's MOE! Specialists + Smart Router = Super Efficient AI!",
            "position": { "x": 225, "y": 280 },
            "style": {
              "bubbleType": "speech",
              "backgroundColor": "#FFFFFF",
              "borderColor": "#000000",
              "fontSize": 18,
              "textAlign": "center"
            }
          },
          {
            "speaker": "Nobita",
            "text": "Now I get it! Like asking the right friend for help!",
            "position": { "x": 225, "y": 340 },
            "style": {
              "bubbleType": "speech",
              "backgroundColor": "#FFFFFF",
              "borderColor": "#000000",
              "fontSize": 18,
              "textAlign": "center"
            }
          }
        ],
        "props": ["completed homework", "MOE device glowing", "friends in background"]
      }
    }
  ],
  "footer": {
    "text": "Mixture of Experts: When AI works like a team of specialist friends! - Doraemon",
    "position": { "x": 540, "y": 1860 },
    "style": {
      "fontFamily": "Doraemon, sans-serif",
      "fontSize": 20,
      "color": "#0095D9",
      "textAlign": "center"
    }
  },
  "soundEffects": [
    {
      "panel": "panel6",
      "text": "BEEP! BOP!",
      "position": { "x": 300, "y": 150 }
    },
    {
      "panel": "panel7",
      "text": "DING!",
      "position": { "x": 225, "y": 80 }
    }
  ]
}
